import React from 'react';
import { Container, Row, Col, Card } from 'reactstrap';

export default class UserIsAlreadyInCore extends React.Component {


    render() {
    return (
        <Card>
            <Container>
                <Row md="12">
                    <h3>{this.props.initials} is already in the core</h3> 
                </Row>
            </Container>

        </Card>
    );
  }
}
